import './css/Learning.css';
import React from 'react';

function Button(props) {
    <a><img src={props.src} className={props.name}></img></a>
}

export default function Learning() {
    return(
        <div className='Learning_menu'>
            <Button name='Learning_Button_Left'></Button>
            <div className='Learning_Book_Left'></div>
            <div className='Learning_Book_Right'></div>
            <Button name='Learning_Button_Right'></Button>
        </div>
    )
}
